import React from "react";
import { Link, NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <React.Fragment>
      <ul className="nav nav-tabs">
        <li className="active">
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">Menu 1</a>
        </li>
        <li>
          <a href="#">Menu 2</a>
        </li>
        <li>
          <a href="#">Menu 3</a>
        </li>
      </ul>
    </React.Fragment>
  );
};

export default NavBar;
